import React from 'react';
import axios from 'axios';

//import PhotoEntry from './PhotoEntry';
//import entries from './data/photo-entries';
const [images, setImages] = React.useState([]);
const [loaded, setIsLoaded] = React.useState(false);


const fetchImages = (count = 10) => {
  const apiRoot = "https://api.unsplash.com";
  const accessKey = "fCrJtMDaRTz2HBjmaO9KSMrSiYFlYpPOmTCCaHa6ln0";

  axios
    .get('${apiRoot}/photos/travel?client_id=${accessKey}&count=${count}')
    .then (res => {
      setImages([...images, ...res.data]);
      setIsLoaded(true);
    });
};

React.useEffect(() => {
  fetchImages();
}, []);

<InfiniteScroll
     dataLength={images}
     next={() => fetchImages(5)}
     hasMore={true}
     loader={
      <img
         src="https://res.cloudinary.com/chuloo/image/upload/v1550093026/scotch-logo-gif_jq4tgr.gif"
         alt="loading"
      />}
 >
     <div className="image-grid" style={{ marginTop: "30px" }}>
        {loaded ? 
            images.map((image, index) => (
                <UnsplashImage url={image.urls.regular} key={index} />
            )): ""}
    </div>
</InfiniteScroll>

export default fetchImages;
